import React from 'react'
import { useContext } from 'react'
import noteContext from '../Context/Notes/noteContext';

const About = async() => {
    const a = await useContext(noteContext);
    return (
        <div>
            My name is {a.name} and my branch is {a.branch}
        </div>
    )
}

export default About
